import React, { Component } from 'react';
import { Row, Col } from 'react-bootstrap';
import './Footer.css'

class Footer extends Component{
    render(){
        return(
            <div className="container-fluid">
                <Row>
                    <Col className="col" xs="4" sm="4" md="4" lg="3">Open Hours</Col>
                    <Col className="col" xs="4" sm="4" md="6" lg="6">Address</Col>
                    <Col className="col" xs="4" sm="4" md="4" lg="3">Social Media</Col>
                </Row>
            </div>
        )
    }
}

export default Footer
